Shows a window containing files and folders that can be selected, the function then returns the location of the selected file/folder. Filters can also be applied. Return: UEResult Arguments: receivedPath: UEPath & The location of the selected file/folder. filters: const std::vector<std::pair< UEString , UEString >>& The filters to select allowed files. Only works if folderOnly is false. To treat this as a empty value use {}. folderOnly: UEBool default : false If true the dialog will only accept the selection of folders, if false only files can be selected. Example: UEPath ReturnedPathLocation;
UEResult Result = FileSelectorDialog( ReturnedPathLocation, {{"Cpp Files", "*.cpp, *.h, *.hpp"}, {"Lua Scripts", "*.lua"}}, false);
if (Result == UEResult::Error)
{ UE_CORE_ERROR("Something went wrong: failed to select file");
}
